import st from "../src/image/web.png";
import javaScript from "../src/image/javaScript.jpg";
import react from "../src/image/react.png";
import php from "../src/image/php.jpg";
import wordpress from "../src/image/wordpress.png";
import web from "../src/image/web.png";

const Sdata = [
    {
        imgsrc: st,
        title: "web design",
    },

    {
        imgsrc: javaScript,
        title: "web development",
    },
    {
        imgsrc: react,
        title: "App development",
    },
    {
        imgsrc: php,
        title: "Web application development",
    },

    {
        imgsrc: wordpress,
        title: "wordpress development",
    },

    {
        imgsrc: web,
        title: "web CMS",
    },

];

export default Sdata;
